import React from 'react';
import useResources from './useResources';

const UserList = () => {
  const users = useResources('posts');
  console.log(users);
  return (
    <ul>
    hola
    {users.map(user => <li key={user.id}>blabla{user.name}</li>)}
    </ul>);
}

export default UserList;
